import React, { memo, useState, useEffect } from "react";

import { Button } from "@rmwc/button"

import '@rmwc/button/styles';

/*
 Simulation Control Component

  props:
     resetAction
     pauseAction
     playAction
 */
function SimControl(props) {
  return (
    <div >
      Simulation Control Component
      <Button label="Reset" />
    </div>
  );
}

export default memo(SimControl);
